<div style="position: fixed; top: 10px; left: 50px; z-index: 1000;
            background-color: white; padding: 10px; border: 2px solid grey; font-family: Arial, sans-serif;">
  <label for="startPicker">Start:</label>
  <input type="datetime-local" id="startPicker" value="2025-07-11T00:00">
  <br>
  <label for="endPicker">End:</label>
  <input type="datetime-local" id="endPicker" value="2025-08-03T23:59">
  <br>
  <button id="prevBtn">Previous</button>
  <button id="nextBtn">Next</button>
</div>

<script>
var geojsonLayers = [];

document.addEventListener('DOMContentLoaded', function() {
  // Collect all GeoJson layers on the map
  map.eachLayer(function(layer) {
    if(layer.feature) {
      geojsonLayers.push(layer);
    }
  });

  function safeParseDate(dateStr) {
    if(!dateStr) return null;
    if(dateStr.indexOf('T') === -1 && dateStr.indexOf(' ') !== -1) {
      dateStr = dateStr.replace(' ', 'T');
    }
    var d = new Date(dateStr);
    return isNaN(d) ? null : d;
  }

  function filterFeaturesByDateRange(start, end) {
    geojsonLayers.forEach(function(layer) {
      layer.eachLayer(function(featureLayer) {
        var dateStr = featureLayer.feature.properties.acquisition_date;
        var featureDate = safeParseDate(dateStr);
        if(featureDate && featureDate >= start && featureDate <= end) {
          featureLayer.setStyle({opacity: 1, fillOpacity: 0.5});
        } else {
          featureLayer.setStyle({opacity: 0, fillOpacity: 0});
        }
      });
    });
  }

  function updateFiltering() {
    var startInput = document.getElementById('startPicker').value;
    var endInput = document.getElementById('endPicker').value;
    if(!startInput || !endInput) return;
    var startDate = new Date(startInput);
    var endDate = new Date(endInput);
    if(isNaN(startDate) || isNaN(endDate)) return;
    filterFeaturesByDateRange(startDate, endDate);
  }

  document.getElementById('startPicker').addEventListener('change', updateFiltering);
  document.getElementById('endPicker').addEventListener('change', updateFiltering);

  document.getElementById('nextBtn').addEventListener('click', function() {
    var startInput = document.getElementById('startPicker');
    var endInput = document.getElementById('endPicker');
    if(!startInput.value || !endInput.value) {
      alert('Please set both start and end datetime values.');
      return;
    }
    var startDate = new Date(startInput.value);
    var endDate = new Date(endInput.value);
    var duration = endDate - startDate;

    var newStart = new Date(endDate.getTime());
    var newEnd = new Date(newStart.getTime() + duration);

    startInput.value = newStart.toISOString().slice(0,16);
    endInput.value = newEnd.toISOString().slice(0,16);
    updateFiltering();
  });

  document.getElementById('prevBtn').addEventListener('click', function() {
    var startInput = document.getElementById('startPicker');
    var endInput = document.getElementById('endPicker');
    if(!startInput.value || !endInput.value) {
      alert('Please set both start and end datetime values.');
      return;
    }
    var startDate = new Date(startInput.value);
    var endDate = new Date(endInput.value);
    var duration = endDate - startDate;

    var newEnd = new Date(startDate.getTime());
    var newStart = new Date(newEnd.getTime() - duration);

    startInput.value = newStart.toISOString().slice(0,16);
    endInput.value = newEnd.toISOString().slice(0,16);
    updateFiltering();
  });

  // Initial filter on load
  updateFiltering();
});
</script>
